import React from 'react';

class CreateCanvas extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      title: "My WorldPin",
      url: null
    }
  }

  handleSubmit = () => {

  }

  handleTitle = () => {

  }

  handleUrl = () => {

  }

  render() {
    return (
      <div id="create-canvas">
        <header className="canvas-title">
          <h1>Create a New Canvas</h1>
        </header>
        <div className="canvas-input">
          <form onSubmit={event => this.handleSubmit(event, this.state)}>
            <h2>Title:</h2><br />
              <h3>Choose a title - preferrably 10 characters or less.</h3><br />
              <input type="text" onChange={this.handleTitle} value={this.state.title} name="title" id="title" /><br /><br/>
            <h2>Map URL:</h2><br />
              <h3>Input a url. To use default map, leave blank.</h3><br />
              <input type="text" placeholder="N/A" onChange={this.handleUrl} value={this.state.url} name="url" id="url" /><br /><br />
              <input type="submit" />
          </form>
        </div>
      </div>
    )
  }
}

export default CreateCanvas;
